import React, {Component} from 'react';
import './App.css';
import Reservation from './components/Reservation'
import ReservationList from './components/ReservaionList';
import Menubar from './components/manubar';

function App() {
  return (
    <div id = 'frame' >  
        <Menubar/>
        <Reservation/>
        <div class="dropdown">
            <button class="btn btn-secondary dropdown-toggle" href="#" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                첫 방문이에요! 방문해서 상담할게요
            </button>
            <ul class="dropdown-menu">                                    
                <li><a class="dropdown-item" href="#">저번 방문이랑 똑같이 해주세요</a></li>
                <li><a class="dropdown-item" href="#">낯을 많이 가려요! 같이 보낸 애착 장난감과 함께 진행해주세요</a></li>
                <li><a class="dropdown-item" href="#">끝나면 바로 연락 주세요! </a></li>
            </ul>
        </div>
    </div>
  );
 }

export default App;
